import './App.css';
import Appbar from './components/Appbar';
import Paper from '@mui/material/Paper';
import React, { useState, useEffect } from 'react';
import TextField from '@mui/material/TextField';
import FormControl from '@mui/material/FormControl';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import Select from '@mui/material/Select';
import Button from '@mui/material/Button';
import Fab from '@mui/material/Fab';
import NavigationIcon from '@mui/icons-material/Navigation';
import './index.css';

const Result = () => {

  const [deps, setDeps] = useState([]);
  useEffect(() => {
    fetch('http://localhost:8080/search/deps')
      .then(response => response.json())
      .then(data => {
        const departmentsData = data.map(departmentName => ({
          value: departmentName,
          label: departmentName
        }));

        setDeps(departmentsData);
      })
      .catch(error => {
        console.error('Error fetching departments:', error);
      });
  }, []);

  const [funcs, setFuncs] = useState([]);
  useEffect(() => {
    fetch('http://localhost:8080/search/func')
      .then(response => response.json())
      .then(data => {
        const departmentsData = data.map(departmentName => ({
          value: departmentName,
          label: departmentName
        }));

        setFuncs(departmentsData);
      })
      .catch(error => {
        console.error('Error fetching departments:', error);
      });
  }, []);

  const [apps, setApps] = useState([]);
  useEffect(() => {
    fetch('http://localhost:8080/search/apps')
      .then(response => response.json())
      .then(data => {
        const departmentsData = data.map(departmentName => ({
          value: departmentName,
          label: departmentName
        }));

        setApps(departmentsData);
      })
      .catch(error => {
        console.error('Error fetching departments:', error);
      });
  }, []);

  const myStyle = {
    //         backgroundImage: 
    //  "url('https://media.geeksforgeeks.org/wp-content/uploads/rk.png')",
    backgroundColor: "#eb8934",
    minHeight: "100vh",
    backgroundSize: 'cover',
    backgroundRepeat: 'repeat',
  }

  const [menus, setMenus] = useState([]);
  useEffect(() => {
    fetch('http://localhost:8080/search/menu')
      .then(response => response.json())
      .then(data => {
        const departmentsData = data.map(departmentName => ({
          value: departmentName,
          label: departmentName
        }));

        setMenus(departmentsData);
      })
      .catch(error => {
        console.error('Error fetching departments:', error);
      });
  }, []);




  const [department, setDepartment] = useState('');
  const [func, setFunc] = useState('');
  const [application, setApplication] = useState('');
  const [menu, setMenu] = useState('');
  const [fileName, setFileName] = useState('');
  const [fileType, setFileType] = useState('');
  const [desc, setDesc] = useState('');
  const [auth, setAuth] = useState('');
  const [files, setFile] = useState(null);

  const handleFileChange = (event) => {
    const selectedFile = event.target.files[0];
    setFile(selectedFile);
  }

  const ITEM_HEIGHT = 48;
  const ITEM_PADDING_TOP = 8;
  const MenuProps = {
    PaperProps: {
      style: {
        maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
        width: 250,
      },
    },
  };

  const handleSubmit = () => {
    const data = {
      departmentName: department,
      functionName: func,
      applicationName: application,
      menuName: menu,
      fileName: fileName,
      fileType: fileType,
      description: desc,
      author: auth,
      file: files
    };
    const url = `http://localhost:8080/add?departmentName=${department}&functionName=${func}&applicationName=${application}&menuName=${menu}&fileName=${fileName}&fileType=${fileType}&description=${desc}&author=${auth}`
    fetch(url, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(data)
    })
      .then(response => {
        // Handle the response
        console.log('Data uploaded successfully:');
        // Reset the form fields
        setDepartment('');
        setFunc('');
        setApplication('');
        setMenu('');
        setFileName('');
        setFileType('');
        setDesc('');
        setAuth('');
        setFile(null);
      })
      .catch(error => {
        // Handle the error
        console.error('Error uploading data:', error);
      });
  };



  return (
    <div style={myStyle}>
      <div> <Appbar className="App" /> </div>
      <div style={{ backgroundColor: "#eb8934", height: '3cm' }}></div>
      <Paper elevation={3} style={{ padding: '2em', margin: '2em' }}>
        <div style={{ display: 'grid', gridTemplateColumns: '1fr 0.3fr 0.8fr' }}>
          <FormControl style={{ width: '30vw' }}>
            <InputLabel id="demo-multiple-name-label">Dept</InputLabel>
            <Select
              labelId="demo-multiple-name-label"
              id="demo-multiple-name"
              select
              onChange={e => setDepartment(e.target.value)}
              input={<OutlinedInput label="Name" />}
              MenuProps={MenuProps}
            >
              {deps.map((name) => (
                <MenuItem
                  key={name.value}
                  value={name.value}
                >
                  {name.label}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
          <h4>Or Department : </h4>
          <input type="text" style={{ fontSize: '1.4em', padding: '0.7em' }} value={department} onChange={e => setDepartment(e.target.value)} />
        </div>
        <div style={{ display: 'grid', gridTemplateColumns: '1fr 0.3fr 0.8fr' }}>
          <FormControl style={{ width: '30vw' }}>
            <InputLabel id="func-id">Func</InputLabel>
            <Select
              labelId="func-id"
              id="func-id"
              select
              onChange={e => setFunc(e.target.value)}
              input={<OutlinedInput label="Name" />}
              MenuProps={MenuProps}
            >
              {funcs.map((name) => (
                <MenuItem
                  key={name.value}
                  value={name.value}
                >
                  {name.label}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
          <h4>Or Function : </h4>
          <input type="text" style={{ fontSize: '1.4em', padding: '0.7em' }} value={func} onChange={e => setFunc(e.target.value)} />
        </div>
        <div style={{ display: 'grid', gridTemplateColumns: '1fr 0.3fr 0.8fr' }}>
          <FormControl style={{ width: '30vw' }}>
            <InputLabel id="demo-multiple-name-label">App</InputLabel>
            <Select
              labelId="demo-multiple-name-label"
              id="demo-multiple-name"
              select
              onChange={e => setApplication(e.target.value)}
              input={<OutlinedInput label="Name" />}
              MenuProps={MenuProps}
            >
              {apps.map((name) => (
                <MenuItem
                  key={name.value}
                  value={name.value}
                >
                  {name.label}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
          <h4>Or Application : </h4>
          <input type="text" style={{ fontSize: '1.4em', padding: '0.7em' }} value={application} onChange={e => setApplication(e.target.value)} />
        </div>
        <div style={{ display: 'grid', gridTemplateColumns: '1fr 0.3fr 0.8fr' }}>
          <FormControl style={{ width: '30vw' }}>
            <InputLabel id="demo-multiple-name-label">Menu</InputLabel>
            <Select
              labelId="demo-multiple-name-label"
              id="demo-multiple-name"
              select
              onChange={e => setMenu(e.target.value)}
              input={<OutlinedInput label="Name" />}
              MenuProps={MenuProps}
            >
              {menus.map((name) => (
                <MenuItem
                  key={name.value}
                  value={name.value}
                >
                  {name.label}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
          <h4>Or Menu : </h4>
          <input type="text" style={{ fontSize: '1.4em', padding: '0.7em' }} value={menu} onChange={e => setMenu(e.target.value)} />
        </div>
      </Paper>
      <Paper elevation={3} style={{ padding: '2em', margin: '2em' }}>
        <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr 1fr 1fr 1fr' }}>
          <div>
            <h4>File Name : </h4>
            <input type="text" style={{ fontSize: '1em', padding: '0.3em' }} value={fileName} onChange={e => setFileName(e.target.value)} />
          </div>
          <div>
            <h4>File Type : </h4>
            <input type="text" style={{ fontSize: '1em', padding: '0.3em' }} value={fileType} onChange={e => setFileType(e.target.value)} />
          </div>
          <div>
            <h4>Author : </h4>
            <input type="text" style={{ fontSize: '1em', padding: '0.3em' }} value={auth} onChange={e => setAuth(e.target.value)} />
          </div>
          <div>
            <h4>Description : </h4>
            <input type="text" style={{ fontSize: '1em', padding: '0.3em' }} value={desc} onChange={e => setDesc(e.target.value)} />
          </div>
          <div>
            <h4>File:</h4>
            <Fab variant="extended" size="small" color="primary" aria-label="add" >
              <NavigationIcon sx={{ mr: 1 }} type='file' onClick={handleFileChange} />
              Upload
            </Fab>
          </div>
        </div>
        <Button variant="contained" onClick={handleSubmit} type="submit" style={{ marginTop: '2em', marginLeft: '30vw' }}>Submit</Button>
      </Paper>
      <div style={{ height: "30px" }} />
    </div >
  );
};

export default Result;
